package main

import (
	"fmt"
)

//var buffer = "mjqjpqmgbljsphdztnvjfqwrcgsmlb"
var buffer = ""

func main() {
	for i, l := range []int{4, 14} {
		for c := range buffer {
			x := make(map[uint8]bool)

			for j := 0; j < l; j++ {
				x[buffer[c+j]] = true
			}

			if len(x) == l {
				fmt.Println("Part", i, ":", c+l)
				break
			}
		}
	}
}
